class Solution {
  int minimumChanges(String s, int k) {
    final n = s.length;
    List<List<int>> dp = List.generate(n + 1, (_) => List.generate(k + 1, (_) => 10000));
    List<List<int>> change = List.generate(n, (_) => List.generate(n, (_) => 0));

    for (int len = 1; len <= n; ++len) {
      for (int i = 0; i + len - 1 < n; ++i) {
        int j = i + len - 1;
        if (len == 1) {
          change[i][j] = 0;
        } else {
          change[i][j] = change[i + 1][j - 1] + (s[i] != s[j] ? 1 : 0);
        }
      }
    }

    dp[0][0] = 0;
    for (int i = 1; i <= n; ++i) {
      for (int j = 1; j <= k; ++j) {
        for (int p = 0; p < i; ++p) {
          dp[i][j] = min(dp[i][j], dp[p][j - 1] + change[p][i - 1]);
        }
      }
    }

    int ans = 10000;
    for (int i = 1; i <= k; ++i) {
      ans = min(ans, dp[n][i]);
    }
    return ans;
  }

  int min(int a, int b) => a < b ? a : b;
}
